import React from "react";
import Tone from "tone";

class Transport extends React.Component {
  state = {};

  transporthandler = () => {
    let transport = new Tone.Transport({});
  };

  render() {
    return (
      <div>
        <button onClick={this.transporthandler} type="button">
          Transport
        </button>
      </div>
    );
  }
}

export default Transport;
